const dSrsSize = 1 << 16

func TestXxx(t *testing.T) {
	currentPath, err := os.Getwd()
	if err != nil {
		println("err-----", err.Error)
	}

	path := strings.Split(currentPath, "/core")[0] + "/srs"
	println("path--------", path)
	domiconSDK, err := kzg.InitDomiconSdk(dSrsSize, path)
	if err != nil {
		println("err---1---", err.Error())
	}

	data, _ := hex.DecodeString("")

	digst, err := domiconSDK.GenerateDataCommit(data)
	if err != nil {
		println("err---2---", err.Error())
	}

	fixedArray := digst.Bytes()
	slice := fixedArray[:]

	commit, _ := hex.DecodeString("0x8bc467e00bc6941c1ad80cd6e448ff8b9d52e3b5c64533a22ad5236e7c6cee56b86a2de85cb4263bcb4f6e0dc4a036f6")

	if bytes.Equal(slice, commit) {
		println("err--3---", err.Error())
	}

}
